$service.EPG.lcnTagMapper.byTag = function (tag) {
	return new Promise(function(resolve, reject) {
		var service = null,
			key, list = $service.EPG.lcnTagMapper.list;
		if (tag) {
			for (key in list) {
				if (list[key].tag === tag) {
					service = list[key];
					break;
				}
			}
		}
		resolve(service);
	});
};

$service.EPG.lcnTagMapper.getIconByTag = function (tag) {
	if (tag) {
		for (var key in this) {
			if (this[key].tag === tag) {
				return this[key].Icon;
			}
		}
	}
	return null;
};

$service.EPG.lcnTagMapper.getTagByServiceId = function (serviceId) {
	if (serviceId) {
		for (var key in this) {
			if (this[key].serviceId === serviceId) {
				return this[key].tag;
			}
		}
	}
	return null;
};

$service.EPG.lcnTagMapper.getLcnByServiceId = function (serviceId) {
	if (serviceId) {
		for (var key in this) {
			if (this[key].serviceId === serviceId) {
				return key;
			}
		}
	}
	return null;
};
